<script>
import anime from "animejs";
import Painterro from "painterro";
export default {
  name: "Session1Page32",
  data() {
    return {
      painterro: null
    }
  },
  mounted() {
    this.$nextTick(() => {
      this.painterro = Painterro({
        id: "painterro",
        activeColor: '#000000',
        activeFillColor: '#ffffff',
        defaultPrimitiveShadowOn: 'true',
        defaultTool: 'brush',
        toolbarPosition: 'bottom',
        availableLineWidths: [1,4,8,12,16,20],
        availableEraserWidths: [1,4,8,12,16,20],
        hiddenTools: ['pixelize','select','crop','text','rotate','resize',
          'open','save','close','settings','redo','zoomin','zoomout'],
        colorScheme: {
          main: '#cfcfcf',
          control: "#ffffff",
          controlContent: '#434649',
          controlShadow: '0px 0px 0px 0.5px #000',
        },
      }).show();
      let info = document.querySelector('.ptro-info');
      info.style.visibility = 'hidden';
    })
    let vh = window.innerHeight;
    let snow = document.getElementsByClassName('snow')[0].children;
    snow.forEach(element => {
      let random_boolean = Math.random() < 0.2;
      if (random_boolean) {
        anime({
          targets: element,
          translateY: Math.floor(Math.random() * 0.1 * vh) + 0.2 * vh,
          opacity: 0,
          duration: Math.floor(Math.random() * 2000) + 1000,
          loop: true,
          easing: 'linear'
        })
      }
    })

    let mainContentAnimation = anime.timeline({
      easing: 'linear',
      duration: 1000,
    });
    mainContentAnimation
      .add({
        targets: '.requires',
        opacity: 0.85,
        delay: 2000,
      })
      .add({
        targets: '.text-box',
        opacity: 0.95,
        duration: 2000,
      })
      .add({
        targets: '#q1',
        color: '#000'
      })
      .add({
        targets: '#q2',
        color: '#000'
      })
      .add({
        targets: '#q3',
        color: '#000'
      })
      .add({
        targets: '#q4',
        color: '#000'
      })
      .add({
        targets: '#q5',
        color: '#000'
      })
      .add({
        targets: '.song-writer',
        opacity: 0.95,
      })
      .add({
        targets: '#painterro',
        opacity: 0.92,
      })
  },
};
</script>

